import React from "react";
import { Link } from "react-router-dom";
import Input from "../components/Input"

const Landing = () => (
  <div>
    <h1>LandingPage</h1>
    <Input/>
    <Link to="/main">Login</Link>
  </div>
);

export default Landing;
